import React from "react";
import "./ActionModal.css";
import { FaCheckCircle } from "react-icons/fa";
import logo from '../components/'

const ActionModal = ({ onClose }) => {
  return (
    <div className="modal-overlay">
      <div className="modal-content">
        {/* Close Button */}
        <button className="modal-close" onClick={onClose}>
          &times;
        </button>

        {/* Logo */}
        <div className="modal-logo">
          <img
            src="https://yourcdn.com/logo.png"
            alt="Franexpo Logo"
          />
        </div>

        {/* Title */}
        <h2 className="modal-title">Select an Option</h2>

        {/* Option Buttons */}
        <div className="modal-buttons">
          <button className="modal-btn">Stall Booking</button>
          <button className="modal-btn">Sponsor Registration</button>
          <button className="modal-btn">Investor Registration</button>
        </div>

        {/* Divider */}
        <div className="modal-divider"></div>

        {/* Why Attend Section */}
        <div className="modal-benefits">
          <h3>Why Attend Franexpo?</h3>
          <ul>
            <li>
              <FaCheckCircle /> Meet 100+ industry-leading brands
            </li>
            <li>
              <FaCheckCircle /> Network with 700+ business visitors
            </li>
            <li>
              <FaCheckCircle /> Explore franchise & investment opportunities
            </li>
            <li>
              <FaCheckCircle /> Hosted at Taj Skyline, Ahmedabad
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default ActionModal;
